import React from "react";
import classes from "./greenOval.module.scss";

const GreenOval = ({ children, ...props }) => {
  return (
    <span {...props}
      style={{
        backgroundColor: "#f4f8ec",
        color: "#6a983c",

        fontFamily: "'Poppins', sans-serif",
        fontWeight: 600,
        fontSize: 12,

        padding: "0 8px",
        borderRadius: 8,
      }}
      className={classes.greenOval}
    >
      {children}
    </span>
  );
};

export default GreenOval;
